import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Header from '../components/Header';
import { createTrip } from '../api/tripService';

function CreateTripPage() {
  const [formData, setFormData] = useState({
    title: '',
    destination: '',
    startDate: '',
    endDate: '',
    travelType: '',
    notes: ''
  });
  
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();
  
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };
  
  const handleSubmit = async (e) => {
    e.preventDefault();
    
    if (!formData.title || !formData.destination || !formData.startDate || !formData.endDate) {
      alert('请填写必填字段');
      return;
    }
    
    try {
      setLoading(true);
      await createTrip(formData);
      alert('行程创建成功！');
      navigate('/');
    } catch (error) {
      console.error('创建行程失败', error);
      alert('创建行程失败，请稍后重试');
    } finally {
      setLoading(false);
    }
  };
  
  const handleBack = () => {
    navigate('/');
  };
  
  return (
    <div className="container">
      <Header title="创建新的行程" showBackButton onBack={handleBack} />
      
      <main className="content">
        <form className="trip-form" onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="title">行程名称</label>
            <input
              type="text"
              id="title"
              name="title"
              value={formData.title}
              onChange={handleInputChange}
              required
              placeholder="给您的行程起个名字"
            />
          </div>
          
          <div className="form-group">
            <label htmlFor="destination">目的地</label>
            <input
              type="text"
              id="destination"
              name="destination"
              value={formData.destination}
              onChange={handleInputChange}
              required
              placeholder="您想去哪里？"
            />
          </div>
          
          <div className="form-row">
            <div className="form-group">
              <label htmlFor="startDate">出发日期</label>
              <input
                type="date"
                id="startDate"
                name="startDate"
                value={formData.startDate}
                onChange={handleInputChange}
                required
              />
            </div>
            
            <div className="form-group">
              <label htmlFor="endDate">结束日期</label>
              <input
                type="date"
                id="endDate"
                name="endDate"
                value={formData.endDate}
                onChange={handleInputChange}
                required
              />
            </div>
          </div>
          
          <div className="form-group">
            <label htmlFor="travelType">出行方式</label>
            <select
              id="travelType"
              name="travelType"
              value={formData.travelType}
              onChange={handleInputChange}
            >
              <option value="">-- 请选择 --</option>
              <option value="self">自由行</option>
              <option value="group">跟团游</option>
              <option value="business">商务出行</option>
              <option value="study">学习考察</option>
            </select>
          </div>
          
          <div className="form-group">
            <label htmlFor="notes">备注</label>
            <textarea
              id="notes"
              name="notes"
              value={formData.notes}
              onChange={handleInputChange}
              placeholder="添加一些关于这次行程的备注..."
              rows="4"
            ></textarea>
          </div>
          
          <button type="submit" className="btn-submit" disabled={loading}>
            {loading ? '创建中...' : '创建行程'}
          </button>
        </form>
      </main>
    </div>
  );
}

export default CreateTripPage;
